class Solution(object):
    def findMaxLength(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        diff = best = 0
        first = {}
        for i, b in enumerate(nums):
            add = 1 if b == 1 else -1
            if -diff - add in first:
                best = max(best, i - first[-diff - add] + 1)

            if -diff not in first:
                first[-diff] = i
            diff += add
        return best

